descr:
Fica a pessoa jurídica notificada sobre a entrega dos laudos de análise de produtos coletados neste estabelecimento:
1. laudo de análise 84.1P.0/2023 do produto "tempero colorífero" marca Rei dos Condimentos, lote 90214, com parecer satisfatório para todas as análises realizadas;
2. laudo de análise 85.1P.0/2023 do produto "barra de cereais" marca Ritter, lote 278, com parecer satisfatório para todas as análises realizadas.
